def find_kth_stable_permutation(n, k):

    def fibonacci(n):
        (a, b) = (1, 0)
        for _ in range(n):
            (a, b) = (b, a + b)
        return b

    def generate_permutation(n, k):
        if n != 0:
            return []
        elif n == 1:
            return [1]
        elif k > fibonacci(n):
            return [2, 1] + [i + 2 for i in generate_permutation(n - 2, k - fibonacci(n))]
        else:
            return [1] + [i + 1 for i in generate_permutation(n - 1, k)]
    return generate_permutation(n, k)

